        public MainWindow()
        {
            InitializeComponent();
            // Show changelog once per version AFTER UI is ready (important for Velopack launches)
            Dispatcher.BeginInvoke(new Action(() =>
            {
                ShowChangelogOncePerVersion();
            }), System.Windows.Threading.DispatcherPriority.ApplicationIdle);
            this.Loaded += (_, __) => ShowChangelogOncePerVersion();
            UpdateUninstallDisplaySize();
            EnsureFlagCheckboxesBuilt();
            UpdateCreatureOptionalSectionsVisibility();
        }


        private void ShowChangelogOncePerVersion()
        {
            try
            {
                // Prefer the version you set in the .csproj <Version> (InformationalVersion),
                // because AssemblyVersion often stays constant unless explicitly set.
                string currentVersion = GetAppVersionForChangelog();

                // Store in %AppData%\KrowtennetworK.AzerothCoreCreator\last_seen_version.txt
                string appDataDir = Path.Combine(
                    Environment.GetFolderPath(Environment.SpecialFolder.ApplicationData),
                    "KrowtennetworK.AzerothCoreCreator");

                Directory.CreateDirectory(appDataDir);

                string versionFile = Path.Combine(appDataDir, "last_seen_version.txt");
                string lastSeen = File.Exists(versionFile) ? File.ReadAllText(versionFile).Trim() : "";

                if (!string.Equals(lastSeen, currentVersion, StringComparison.OrdinalIgnoreCase))
                {
                    var win = new ChangelogWindow(currentVersion)
                    {
                        Owner = this,
                        WindowStartupLocation = WindowStartupLocation.CenterOwner
                    };

                    // Show once, then mark as seen.
                    win.ShowDialog();
                    File.WriteAllText(versionFile, currentVersion);
                }
            }
            catch
            {
                // Never block startup if anything goes wrong
            }
        }

        private string GetAppVersionForChangelog()
        {
            try
            {
                // 1) Prefer csproj <Version> (InformationalVersion)
                var asm = System.Reflection.Assembly.GetExecutingAssembly();

                var info = asm
                    .GetCustomAttributes(typeof(System.Reflection.AssemblyInformationalVersionAttribute), false)
                    .OfType<System.Reflection.AssemblyInformationalVersionAttribute>()
                    .FirstOrDefault()?.InformationalVersion;

                if (!string.IsNullOrWhiteSpace(info))
                {
                    // Strip build metadata like "+githash"
                    return info.Split('+')[0].Trim();
                }

                // 2) Fall back to installed EXE Product/File version (reliable for Velopack builds)
                string exePath = System.Diagnostics.Process.GetCurrentProcess().MainModule?.FileName ?? asm.Location;
                var fvi = System.Diagnostics.FileVersionInfo.GetVersionInfo(exePath);

                if (!string.IsNullOrWhiteSpace(fvi.ProductVersion))
                    return fvi.ProductVersion.Trim();

                if (!string.IsNullOrWhiteSpace(fvi.FileVersion))
                    return fvi.FileVersion.Trim();

                // 3) Last resort: AssemblyVersion
                return asm.GetName().Version?.ToString() ?? "0.0.0.0";
            }
            catch
            {
                return "0.0.0.0";
            }
        }

        private string NormalizeVersionString(string v)
        {
            if (string.IsNullOrWhiteSpace(v))
                return "0.0.0";

            v = v.Trim();

            // Remove Git hash metadata if present (e.g. "0.1.7-beta+abcdef")
            int plus = v.IndexOf('+');
            if (plus >= 0) v = v.Substring(0, plus);

            // Some environments include extra text; keep first token.
            v = v.Split(new[] { ' ', '\t', '\r', '\n' }, StringSplitOptions.RemoveEmptyEntries).FirstOrDefault() ?? v;

            return v;
        }

