        private void QuestRewardMoneyParts_Changed(object sender, TextChangedEventArgs e)
        {
            // Convert gold/silver/copper into total copper for RewardMoney (legacy textbox used by SQL generation).
            long gold = ParseLongSafe(QuestRewardMoneyGoldBox?.Text);
            long silver = ParseLongSafe(QuestRewardMoneySilverBox?.Text);
            long copper = ParseLongSafe(QuestRewardMoneyCopperBox?.Text);

            if (gold < 0) gold = 0;
            if (silver < 0) silver = 0;
            if (copper < 0) copper = 0;

            long totalCopper = (gold * 10000L) + (silver * 100L) + copper;
            QuestRewardMoneyBox.Text = totalCopper.ToString();

            QuestPreview_Changed(sender, e);
        }

        private static long ParseLongSafe(string s)
        {
            if (string.IsNullOrWhiteSpace(s)) return 0;
            long.TryParse(s.Trim(), out long v);
            return v;
        }


