        // QoL: If a user clicks a Find button without focusing a target TextBox first,
        // automatically infer the most likely target TextBox near that button.
        private TextBox ResolveLookupTargetFromSender(object sender, TextBox lastFocusedFallback)
        {
            // 1) If we have a valid last-focused target, keep honoring it.
            if (lastFocusedFallback != null && lastFocusedFallback.IsVisible && lastFocusedFallback.IsEnabled)
                return lastFocusedFallback;

            if (sender is not DependencyObject dep)
                return null;

            // 2) Try to find a TextBox in the same Grid row, to the left of the clicked button.
            var rowSibling = TryFindSiblingTextBoxLeftInSameGridRow(dep);
            if (rowSibling != null)
                return rowSibling;

            // 3) Otherwise, search within the nearest GroupBox (common pattern for your Quest/Creature blocks).
            var group = FindParent<GroupBox>(dep);
            if (group != null)
            {
                foreach (var tb in FindVisualChildren<TextBox>(group))
                {
                    if (tb.IsVisible && tb.IsEnabled)
                        return tb;
                }
            }

            // 4) Fall back to first visible TextBox in the window (last resort).
            foreach (var tb in FindVisualChildren<TextBox>(this))
            {
                if (tb.IsVisible && tb.IsEnabled)
                    return tb;
            }

            return null;
        }

        private static T FindParent<T>(DependencyObject child) where T : DependencyObject
        {
            DependencyObject current = child;
            while (current != null)
            {
                if (current is T t)
                    return t;
                current = VisualTreeHelper.GetParent(current);
            }
            return null;
        }

        private static TextBox TryFindSiblingTextBoxLeftInSameGridRow(DependencyObject clicked)
        {
            // Walk up until we find a Grid parent.
            DependencyObject current = clicked;
            Grid grid = null;
            DependencyObject gridChild = null;

            while (current != null)
            {
                if (current is Grid g)
                {
                    grid = g;
                    break;
                }
                gridChild = current;
                current = VisualTreeHelper.GetParent(current);
            }

            if (grid == null || gridChild == null)
                return null;

            if (gridChild is not UIElement gridChildEl)
                return null;

            int row = Grid.GetRow(gridChildEl);
            int col = Grid.GetColumn(gridChildEl);

            TextBox best = null;
            int bestCol = int.MinValue;

            foreach (UIElement child in grid.Children)
            {
                if (child is TextBox tb && tb.IsVisible && tb.IsEnabled)
                {
                    if (Grid.GetRow(child) == row)
                    {
                        int tbCol = Grid.GetColumn(child);
                        if (tbCol < col && tbCol > bestCol)
                        {
                            bestCol = tbCol;
                            best = tb;
                        }
                    }
                }
            }

            return best;
        }

