                _titleCache = LoadTitlesFromEmbeddedData()
                    .OrderBy(r => r.Id)
                    .ToList();
            }
            catch (Exception ex)
            {
                _titleCache = new List<LookupRow>();
                _titleCacheLoadError = ex.Message;
            }
        }


