        private IEnumerable<string> EnumerateSpellDataLines()
        {
            foreach (var chunk in _spellDataChunks)
            {
                using (var sr = new StringReader(chunk))
                {
                    string line;
                    while ((line = sr.ReadLine()) != null)
                        yield return line;
                }
            }
        }

        private List<LookupRow> LoadSpellsFromEmbeddedData()
        {
            var list = new List<LookupRow>(60000);

            foreach (var line in EnumerateSpellDataLines())
            {
                if (string.IsNullOrWhiteSpace(line))
                    continue;

                int tab = line.IndexOf('\t');
                if (tab <= 0)
                    continue;

                if (!int.TryParse(line.Substring(0, tab), out int id))
                    continue;

                string name = line.Substring(tab + 1).Trim();
                if (name.Length == 0)
                    continue;

                list.Add(new LookupRow { Id = id, Name = name });
            }

            return list;
        }

